import { Button, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, TextField } from '@mui/material';
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../App.css';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';
import { useNavigate } from 'react-router-dom';

const UserList = () => {
    const navigate = useNavigate();
    const [users, setUsers] = useState([]);
    const [searchValue, setSearchValue] = useState('');
    const [open, setOpen] = useState(false);

    const handleAddUser = () => {
        console.log('Adicionar novo usuário');
        navigate("/userDetails");
    };

    const handleSearch = () => {
        console.log('Pesquisar usuários com o valor:', searchValue);
    };

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    useEffect(() => {
        // Função para buscar todos os usuários
        const fetchUsers = async () => {
            try {
                const response = await axios.get('/api/pessoas');
                setUsers(response.data);
                console.warn(users);
            } catch (error) {
                console.error('Erro ao buscar usuários:', error);
                setUsers([]);
            }
        };

        // Chama a função para buscar os usuários ao montar o componente
        fetchUsers();
    }, []); // O array vazio como segundo argumento indica que o efeito será executado apenas uma vez, após a montagem do componente


    return (
        <div className="App">
            <div className="search-and-create">
                <div className="search">
                    <TextField
                        fullWidth={true}
                        size='small'
                        label="Pesquisar por Nome"
                        value={searchValue}
                        onChange={(e) => setSearchValue(e.target.value)}
                    />
                </div>
                <div className='btn-search'>
                    <Button variant="contained" onClick={handleSearch}>Pesquisar</Button>
                </div>
                <div className='btn-new-user'>
                    <Button variant="contained" onClick={handleAddUser}>Novo Usuário</Button>
                </div>
            </div>
            <h2 className='title-page'> Usuários </h2>
            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Nome</TableCell>
                            <TableCell>CPF/CNPJ</TableCell>
                            <TableCell>Telefone</TableCell>
                            <TableCell>Email</TableCell>
                            <TableCell>Endereços Comerciais</TableCell>
                            <TableCell>Endereços Residenciais</TableCell>
                            <TableCell>Ações</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {users.map((user) => (
                            <TableRow key={user.id}>
                                <TableCell>{user.name}</TableCell>
                                <TableCell>{user.cpf_cnpj}</TableCell>
                                <TableCell>{user.phone}</TableCell>
                                <TableCell>{user.email}</TableCell>
                                <TableCell className='address'>{user.businessAddresses}</TableCell>
                                <TableCell className='address'>{user.residentialAddresses}</TableCell>
                                <TableCell className='buttons'>
                                    <Button variant="contained" color="primary">Editar</Button>
                                    <Button className='btn-remove' variant="contained" onClick={handleClickOpen} color="error">Excluir</Button>
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>

            <Dialog
                open={open}
                onClose={handleClose}
                aria-labelledby="alert-dialog-title"
                aria-describedby="alert-dialog-description"
            >
                <DialogTitle id="alert-dialog-title">
                    {"Deseja realmente excluir este usuário?"}
                </DialogTitle>
                <DialogContent>
                    <DialogContentText id="alert-dialog-description">
                        Esta ação é irreversível
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose}>Não</Button>
                    <Button onClick={handleClose} autoFocus> Sim </Button>
                </DialogActions>
            </Dialog>
        </div>
    );
};

export default UserList;
